window.bookSummaryJSON = "<p>\"Like it or not, Brian, the moment you gave that Cinderella interview on <i>The Kenneth Long Show</i>, you changed her life. There's no going back for her, so help her move forward. Help her make the best of a hard situation.\"&nbsp;&nbsp;&nbsp;</p> <p>The end of one story is often the beginning of another. Hollywood heartthrob Brian Oliver and his Cinderella princess Ellamara Rodriguez have finally found love outside the digital world. But leaving their anonymity behind creates a whole new set of obstacles for the nation's new favorite sweethearts. With the stress of Brian's fame, Ella's disapproving family, and the pressures of a new relationship weighing down on them, the It Couple quickly begins to wonder if they can hold on to their newfound joy, or if maybe happily ever after is only a fairy tale.</p>"; 
